import ReactDOM from 'react-dom';
import {BrowserRouter, Route} from 'react-router-dom'

import './index.css';
import App from './App';

ReactDOM.render(
<BrowserRouter>
    <Route path='/'><App /></Route>
</BrowserRouter>, document.getElementById('root'));
